import React from 'react'
import {useDispatch} from 'react-redux'
import {newSales} from '../../redux/Action'

function NewSales() {
    const dispatch = useDispatch()
    return (
        <div className="w3-container mt-3">
            <span className="w3-right w3-text-red w3-button" onClick={()=>dispatch(newSales(false))}>* close</span>
            <SalesForm />
        </div>
    )
}

export default NewSales
